        int n = operator.size();
        for (int i = 0; i < n; i++) {
            if (operator.get(i).equals("+")) {
                operand.set(i, operand.get(i) + operand.get(i + 1));
                operand.remove(i + 1);
                operator.remove(i);
                n--;
                i--;
            } else if (operator.get(i).equals("*")) {
                operand.set(i, operand.get(i) * operand.get(i + 1));
                operand.remove(i + 1);
                operator.remove(i);
                n--;
                i--;
            } else if (operator.get(i).equals("-")) {
                operand.set(i, operand.get(i) - operand.get(i + 1));
                operand.remove(i + 1);
                operator.remove(i);
                n--;
                i--;
            } else if (operator.get(i).equals("//")) {
                operand.set(i, operand.get(i) / operand.get(i + 1));
                operand.remove(i + 1);
                operator.remove(i);
                n--;
                i--;
            } else if (operator.get(i).equals("**")) {
                operand.set(i, (int) Math.pow(operand.get(i), operand.get(i + 1)));
                operand.remove(i + 1);
                operator.remove(i);
                n--;
                i--;
            }
        }
        return operand.get(0);
    }
